import React from 'react';
import { Link } from 'react-router-dom';
import { AltBannerContainer, AltBannerTextBackgroundGreen, AltBannerTextBackgroundYellow, AltBannerTextBackgroundRed } from './alt-banner.styles';

import { BannerText, HeaderLineBreak } from './banner.styles';

const AltBanner = () => {
    return (
        <AltBannerContainer>
          <AltBannerTextBackgroundRed>
            &nbsp;
          </AltBannerTextBackgroundRed>
          <AltBannerTextBackgroundYellow>
            &nbsp;<br/>&nbsp;
          </AltBannerTextBackgroundYellow>
          <AltBannerTextBackgroundGreen>
            <BannerText>
            <span className='' style={{fontSize: '2.3em'}}>FRESH BEATS FOR SALE</span>
            <HeaderLineBreak />
            <span className='' style={{fontSize: '.5em', lineHeight: '1em'}}>You keep 100% royalties as an artist when you publish
            <HeaderLineBreak />
            Stems, Unmastered & Mastered Wav, & NFTs available</span><HeaderLineBreak />
            <Link to='/beats-for-sale'><CustomButton style={{fontSize: '30px'}}> Listen and Shop for fresh beats</CustomButton></Link>
            <hr/>
            </BannerText>
          </AltBannerTextBackgroundGreen>
        </AltBannerContainer>
    );
};

export default AltBanner;
